import React from "react";
import { BrowserRouter, Route } from "react-router-dom";
import Cards from "./componetns/Cards";
import Footerres from "./componetns/Footerres";
import Home from "./componetns/Home";
import Navbares from "./componetns/Navbares";
import 'bootstrap/dist/css/bootstrap.min.css';
import Addrestaurant from "./pages/addRestaurants/Addrestaurant";

function App() {
  return (
    <BrowserRouter>
      <Navbares />
      <Route path="/home" component={Home} />
      <Route path="/addRestaurants" component={Addrestaurant} />
      <Footerres />
    </BrowserRouter>
  );
}

export default App;
